script: |
  super -f tsv -I q4326.sql | sort > q4326.out

vector: true

inputs:
  - name: q4326.sql
    data: |
      SELECT ALL * FROM tab2 WHERE ( col2 * 22 / + col1 + - col1 ) NOT BETWEEN + col2 * ( + col1 ) AND col2;
  - name: tab2

outputs:
  - name: q4326.out
    data: |
      46	51	23
      64	77	40
      75	67	58
